INSERT INTO `industry_project` VALUES ('1', '1', '低压槽', '张家辉', '张家辉、文宁', '张家辉、徐静蕾、何炅、余男', '“孤城”是一座浮华却堕落的罪恶之城，警方卧底于秋（张家辉饰）在上司阿占（何炅饰）的运筹帷幄之下，成功斡旋于多方黑恶势力之中，长期卧底生活也让于秋渐渐迷失自我。然而，于秋内心对惩治罪恶的欲望从未消减，他重整旗鼓决定回归，而这一次，阿占给他的任务竟然是调查罪恶之城背后最邪恶也最神秘的黑手、令人闻风丧胆的头目——“老板”。通过一宗儿童绑架案，于秋和阿占终于摸清老板底细，对方已经控制了商界和黑道，更将势力渗透至警方权力高层，令所有人没想到的是，于秋在追查过程中已经踏入老板设下的重重圈套。腹背受敌的于秋在层层迷局之中，似乎被推向更深的绝望之中。', '1', null, null, '', null, 'http://124.223.119.22/profile/upload/2022/10/19/低压槽_20221019144826A006.avif', '2018-04-18 00:00:00');
INSERT INTO `industry_project` VALUES ('2', '1', '降魔传', '王晶', '', '郑恺、张雨绮', '《降魔传》讲述了南宋年间妖怪肆虐的杭州城，玄光寺不通和尚下山降妖除魔，邂逅女魔师菁菁，两人在降魔途中相遇，齐心协力，排除千难万险，打败了妖魔并最终找回彼此之间相爱的记忆的故事。', '3', null, null, '', '', 'http://124.223.119.22/profile/upload/2022/10/19/降魔转_20221019145322A009.avif', '2017-11-17 00:00:00');
INSERT INTO `industry_project` VALUES ('5', '1', '天蓬归来', '方晓罡', '', '赵圆瑗、陈信喆、李佳潼、黄宥天', '《天蓬归来》讲述的是大龄剩女高小姐嫁给见义勇为的猪刚鬣，展开了一场错位恋情，最终高小姐为救心爱之人牺牲了自己的感人故事。', '2', null, null, '', null, 'http://124.223.119.22/profile/upload/2022/10/19/天蓬归来竖_20221019145310A008.avif', '2018-11-02 00:00:00');
INSERT INTO `industry_project` VALUES ('6', '1', '寻龙诀', '', '', '', '', '1', null, null, '爱奇艺，优酷', null, 'http://124.223.119.22/profile/upload/2022/10/19/寻龙劫_20221019145301A007.avif', '2022-11-21 16:47:17');
INSERT INTO `industry_project` VALUES ('11', '1', '野猪', '野猪泓', '', '闫昌、王轩堃、侯桐江、刘东明', '一只凶猛的野猪闯入了世外桃源高老庄。捉猪，土枪误伤了老村长的屁股，混乱从此开始。一系列阴差阳错与不期而遇，煞有介事的灵魂深处摆放着无处躲藏的纠结与孤独。野猪&高老庄，一部魔幻现实主义的原乡狂想曲，阐述着所有未被澄清的希望与梦想。', '7', null, null, '', null, 'http://124.223.119.22/profile/upload/2022/10/19/野猪_20221019163218A022.avif', '2020-01-10 00:00:00');
INSERT INTO `industry_project` VALUES ('22', '2', '剑王朝', '马华干', '', '李现、李一桐、刘奕君、姚笛、赵圆瑗', '《剑王朝》根据无罪同名小说改编，讲述了身份神秘的市井酒铺少年丁宁，历经江湖的种种磨练以剑逆袭，在危难之中选择“大义”获得成长的故事。', '3', null, null, '', '', 'http://124.223.119.22/profile/upload/2022/10/19/剑王朝_20221019145427A010.avif', '2022-11-21 00:00:00');
INSERT INTO `industry_project` VALUES ('111', '2', '千古玦尘', '尹涛、李才', '', '周冬雨、许凯、张嘉倪、刘学义、赖艺、罗秋韵、张雅钦', '《千古玦尘》根据星零所著仙侠小说《上古》改编，讲述了混沌之劫因主神上古的重生卷土重来。白玦为了不让上古再次牺牲，修炼出和主神一样的混沌之力，又为了不让上古伤心，对其绝情以令其断情，并最终代替上古以身化劫。上古失去挚爱， 终于明了白玦为自己做的一切。她肝肠寸断，唯用余生在天地间找寻着消散的爱人', '2', null, null, '爱奇艺，腾讯', null, 'http://124.223.119.22/profile/upload/2022/10/19/千古玦尘竖_20221019145501A011.avif', '2022-11-21 00:00:00');
INSERT INTO `industry_project` VALUES ('2222', '2', '玩宝', '', '', '', '腾讯出品我司承制的短剧《玩宝》，2021年4月在腾讯微视上线播出，目前累计点播2384万，连续两周稳居周热榜第一，并且在微视同期上线短剧中排名第一，完播率在平台短剧中排名第二。后来被腾讯视频选中登录电视剧精选频道。', '4', null, null, '', '', 'http://124.223.119.22/profile/upload/2022/10/19/玩宝_20221019145522A012.avif', '2022-11-21 00:00:00');
