INSERT INTO `industry_project` VALUES ('2233', '1', '摸骨大师', '陈寅', '陈岑翊', '谢宁、韩涛、戚圣捷、任盛华', '《摸骨大师》由浙江蛇足影业、陈寅文化传播工作室联手打造爆笑都市悬疑喜剧电影，该片由著名导演陈寅强势打造，国内实力派演员谢宁联合杭州滑稽剧团众多实力演员与青年演员韩涛、戚圣捷、任盛华联袂出演。', '5', null, null, '', null, 'http://124.223.119.22/profile/upload/2022/10/19/摸骨大师.avif', '2022-12-05 14:31:03');
INSERT INTO `industry_project` VALUES ('2236', '2', '隋唐英雄', '李翰韬', '', '陈冲、刘晓庆、赵文瑄、余少群、孙耀琦、张瑞希、蓝燕、张卫健、蒲巴甲、张睿', '《隋唐英雄》讲述了从隋朝建立开始一直到衰亡，李世民登上帝位开创贞观之治为终，重现了隋炀帝、李世民等各路君王豪杰荡气回肠的一生。', '1', null, null, '', null, 'http://124.223.119.22:8081/profile/upload/2022/12/16/隋唐英雄海报_20221216140942A002.avif', '2022-12-16 14:10:20');
