INSERT INTO `industry_project` VALUES ('2239', '2', '我的23岁美女邻居', '', '', '', '我司参与腾讯出品的现代都市甜宠短剧《我的23岁美女邻居》，改编自樱花墨墨同名小说，目前正在后期制作中，预计年底上线。', '8', null, null, '', null, 'http://124.223.119.22:8081/profile/upload/2022/12/16/a9dd5976b8391a074b61ca0d67028b2e_t014b5bb393fc4139ec_20221216141957A005.jpg', '2022-12-16 00:00:00');
INSERT INTO `industry_project` VALUES ('2240', '4', '萌仔萌萌宅', '', '', '', '《萌仔萌萌宅》是芒果TV打造的全国首档明星夫妻育儿体验观察记节目。一对明星夫妻隐居山林育儿初体验，打造亲子系“向往的生活”，柴米油盐酱醋茶，琴棋书画诗酒花，带你体验现代家庭的原生态生活模式。', '4', null, null, '', null, 'http://124.223.119.22:8081/profile/upload/2022/12/20/1671509448572_20221220121125A008.png', '2022-12-20 12:11:26');
INSERT INTO `industry_resources` VALUES ('5', '艺术总监', '张意法', '艺术总监', null, '', null, null, null, 'http://124.223.119.22/profile/upload/2022/10/19/张意法，艺术总监。_20221019110119A001.avif', '3', null, null);
INSERT INTO `industry_resources` VALUES ('6', '制作人、导演', '蔺水净', '擅长故事主线走向把控,有严谨缜密的逻辑思维,精益求精的创作态度。', null, '<p class=\"MsoNormal\">2014年担任由郭京飞主演的悬疑剧《暗黑者》(改编自周浩晖小说《死亡通知单》)的B组导演（腾讯视频播出）。<o:p></o:p></p><p class=\"MsoNormal\">2015年执导《完美案件》《六棱镜》 《游戏时间到》等悬疑剧在爱奇艺和腾讯视频播出。<o:p></o:p></p><p class=\"MsoNormal\">2021年，网剧《加油呀!茉莉》导演。<o:p></o:p></p><p class=\"MsoNormal\">2020年，网剧《约定期间爱上你》监制，上线三周破4000万。<o:p></o:p></p><p class=\"MsoNormal\">2019年，网剧《不知东方既白》导演，腾讯视频播出。<o:p></o:p></p><p class=\"MsoNormal\">2019年，网剧《御狐之绊》导演/编剧。<o:p></o:p></p><p class=\"MsoNormal\">2017年，网络大电影《斗战胜佛》导演/编剧 ，分账：1311万。<o:p></o:p></p><p class=\"MsoNormal\">2014年，悬疑剧《暗黑者》B组导演，豆瓣8.2评分，点击量达到 27.7 亿次。<o:p></o:p></p><p class=\"MsoNormal\">2014年，网剧《匆匆那年》选角导演，豆瓣8.1评分。<span style=\"mso-spacerun:\'yes\';font-family:宋体;mso-ascii-font-family:Calibri;\nmso-hansi-font-family:Calibri;mso-bidi-font-family:\'Times New Roman\';font-size:10.5000pt;\nmso-font-kerning:1.0000pt;\"><o:p></o:p></span></p>', null, null, null, 'http://124.223.119.22/profile/upload/2022/10/19/蔺水净，导演，内地新锐制作人。_20221019105509A001.avif', '5', null, null);
INSERT INTO `industry_resources` VALUES ('7', '导演', '王聪', '内地新锐导演', null, '<p class=\"MsoNormal\">2021年，导演悬疑惊悚网络电影《狩夜人之湘西往事》。<o:p></o:p></p><p class=\"MsoNormal\">2021年，导演腾讯微视悬疑类型短剧《玩宝》 ，总播放量超过2300W。<o:p></o:p></p><p class=\"MsoNormal\">2019年，快手爆款短剧御儿古风之《一胎二宝》跨世遇到爱，总播放量3.5亿。 <o:p></o:p></p><p class=\"MsoNormal\">2019年，网络电影电影《倩女仙缘1》《倩女仙缘2》。 <o:p></o:p></p><p class=\"MsoNormal\">2017年，奇幻动作喜剧电影《大梦西游４伏妖记》导演， 票房分账超过1500万元 。<o:p></o:p></p><p class=\"MsoNormal\">2017年，喜剧武侠电影《白夜侠》导演。 <o:p></o:p></p><p class=\"MsoNormal\">2017年，网络古装剧《芈月传奇之战国红颜》，担任摄影师。 <o:p></o:p></p><p class=\"MsoNormal\">2015年5月—2015年8月，网络剧《一起同过窗》导演。<span style=\"mso-spacerun:\'yes\';font-family:宋体;mso-ascii-font-family:Calibri;\nmso-hansi-font-family:Calibri;mso-bidi-font-family:\'Times New Roman\';font-size:10.5000pt;\nmso-font-kerning:1.0000pt;\"><o:p></o:p></span></p>', null, null, null, 'http://124.223.119.22/profile/upload/2022/10/19/王聪，内地新锐导演。_20221019110659A002.avif', '6', null, null);
INSERT INTO `industry_resources` VALUES ('8', '制片人', '赵善磊', '大幕影视传媒有限公司CEO，硕士，熟悉影视行业产业链，擅长影视制作项目管理工作，参与近百部影视项目后期（特 效）设计制作、经济评价、可行性研究分析等工作，参与项目多次获得了全国飞天奖、金鹰奖和省市的“五个一工程奖”。', null, '<p class=\"MsoNormal\">《玩宝》、《拆弹专家》（刘德华主演）、《降魔传》（王晶导演）、《低压槽》（张家辉主演）、《五星红旗迎风飘扬》、 《隋唐英雄》、《武则天秘史》、《旗袍》、《大鱼》、《天蓬归来》等。<span style=\"mso-spacerun:\'yes\';font-family:宋体;mso-ascii-font-family:Calibri;\nmso-hansi-font-family:Calibri;mso-bidi-font-family:\'Times New Roman\';font-size:10.5000pt;\nmso-font-kerning:1.0000pt;\"><o:p></o:p></span></p>', null, null, null, 'http://124.223.119.22/profile/upload/2022/10/19/赵善磊,制片人，大幕影视 传媒有限公司CEO。_20221019143824A001.avif', '1', null, null);
INSERT INTO `industry_resources` VALUES ('9', '制片人', '童文群', '浙江铁幕真影业有限公司CEO ，编剧，制片人。', null, '<p class=\"MsoNormal\">&nbsp;2021年犯罪悬疑类院线电影《辑魂》获得1.11亿票房；另外参与过： 《巴黎假期》、《危城》、《诡丝》、《赤壁》、《墨攻》、《老大人》、《陪你很久很久》、《郊区的鸟》等。<o:p></o:p></p><p class=\"MsoNormal\">《郊区的鸟》获得了FIRST青年电影展最佳影片、入围瑞士洛加诺国际电 影节等。<o:p></o:p></p><p class=\"MsoNormal\">出品的悬疑罪案片《目击者之追凶》被誉为“2017年最好的华语悬疑片”。<span style=\"mso-spacerun:\'yes\';font-family:宋体;mso-ascii-font-family:Calibri;\nmso-hansi-font-family:Calibri;mso-bidi-font-family:\'Times New Roman\';font-size:10.5000pt;\nmso-font-kerning:1.0000pt;\"><o:p></o:p></span></p>', null, null, null, 'http://124.223.119.22/profile/upload/2022/10/19/童文群，编剧，制片人，浙江铁幕真影业有限公司CEO 。_20221019144013A002.avif', '1', null, null);
INSERT INTO `industry_resources` VALUES ('10', '编剧', '孙天禾', '中广联编剧工作委员会会员，浙江省新光计划入选人。先后就读于北京电影学院、英国威斯敏斯特大学。从业多年，导演、编剧众多影视作品，拥有丰富的影视制作经验。', null, '<p class=\"MsoNormal\">电影作品：《梭哈人生》、《特战王妃》系列、《无人回望》、《晴空》等。<o:p></o:p></p><p class=\"MsoNormal\">电视剧作品：《玩宝》、《红灯记》、《遇见最好的自己》、《隋唐英雄》、《冷枪手》、《九九艳阳天》、《布袋和尚新传》、《独立纵队2》、《群英会》、《天下第一刀》、《大西北剿匪记》、《红色追剿1949》等。<span style=\"mso-spacerun:\'yes\';font-family:宋体;mso-ascii-font-family:Calibri;\nmso-hansi-font-family:Calibri;mso-bidi-font-family:\'Times New Roman\';font-size:10.5000pt;\nmso-font-kerning:1.0000pt;\"><o:p></o:p></span></p>', null, null, null, 'http://124.223.119.22/profile/upload/2022/10/19/孙天禾，编剧。_20221019144135A003.avif', '6', null, null);
INSERT INTO `industry_resources` VALUES ('11', '摄影指导', '袁广安', '资深摄影师，从业多年，参与多部影视剧拍摄制作', null, '<p class=\"MsoNormal\">电影作品：《阴阳路》；《致命还击》；《碟仙诡谈2》；《大戏台》等；<o:p></o:p></p><p class=\"MsoNormal\">电视剧作品：《破冰行动》；《国门行动》；《三个女人的秘密》；《花非花雾非雾》；《族魂》；《连环套》；《猎狼人》； 《蔷薇的战争》；《致命名单》；《金牌律师》；《枪口》等。<span style=\"mso-spacerun:\'yes\';font-family:宋体;mso-ascii-font-family:Calibri;\nmso-hansi-font-family:Calibri;mso-bidi-font-family:\'Times New Roman\';font-size:10.5000pt;\nmso-font-kerning:1.0000pt;\"><o:p></o:p></span></p>', null, null, null, 'http://124.223.119.22/profile/upload/2022/10/19/袁广安，摄影指导，资深摄影师。_20221019144223A004.avif', '7', null, null);
INSERT INTO `industry_resources` VALUES ('12', '动作指导', '李想', '国家武英级武术运动员，影视行业从业多年，参与院线网大动作指导、导演百十余部。 参与作品：', null, '<p class=\"MsoNormal\">2000年---- 《天脉传奇》<o:p></o:p></p><p class=\"MsoNormal\">2001-2002年---- 《杀死比尔》<o:p></o:p></p><p class=\"MsoNormal\">2004年---- 《功夫》<o:p></o:p></p><p class=\"MsoNormal\">2005年---- 《霍元甲》<o:p></o:p></p><p class=\"MsoNormal\">2005年---- 《夜宴》<o:p></o:p></p><p class=\"MsoNormal\">2007年 ---- 《赵氏孤儿》<o:p></o:p></p><p class=\"MsoNormal\">2007年---- 《画壁》<o:p></o:p></p><p class=\"MsoNormal\">2008年---- 《功夫侠》<o:p></o:p></p><p class=\"MsoNormal\" style=\"\">2009年---- 《四大名捕1,2,3》<span style=\"mso-spacerun:\'yes\';font-family:宋体;mso-ascii-font-family:Calibri;\nmso-hansi-font-family:Calibri;mso-bidi-font-family:\'Times New Roman\';font-size:10.5000pt;\nmso-font-kerning:1.0000pt;\"><o:p></o:p></span></p>', null, null, null, 'http://124.223.119.22/profile/upload/2022/10/19/李想，动作指导。_20221019144405A005.avif', '8', null, null);
