INSERT INTO `sys_oper_log` VALUES ('432', '产业资源', '2', 'com.ruoyi.system.controller.IndustryResourcesController.editSave()', 'POST', '1', 'admin', '研发部门', '/system/resources/edit', '218.57.140.131', 'XX XX', '{\"id\":[\"6\"],\"type\":[\"2\"],\"projectName\":[\"蔺水净\"],\"synopsis\":[\"擅长故事主线走向把控,有严谨缜密的逻辑思维,精益求精的创作态度。\"],\"mainWorks\":[\"<p>2014年担任由郭京飞主演的悬疑剧《暗黑者》(改编自周浩晖小说《死亡通知单》)的B组导演（腾讯视频播出）。</p><p><span style=\\\"color: inherit;\\\">2015年执导《完美案件》《六棱镜》 《游戏时间到》等悬疑剧在爱奇艺和腾讯视频播出。</span></p><p><span style=\\\"color: inherit;\\\">2021年，网剧《加油呀!茉莉》导演。</span></p><p><span style=\\\"color: inherit;\\\">2020年，网剧《约定期间爱上你》监制，上线三周破4000万。2019年，网剧《不知东方既白》导演，腾讯视频播出。</span></p><p><span style=\\\"color: inherit;\\\">2019年，网剧《御狐之绊》导演/编剧。</span></p><p><span style=\\\"color: inherit;\\\">2017年，网络大电影《斗战胜佛》导演/编剧 ，分账：1311万。</span></p><p><span style=\\\"color: inherit;\\\">2014年，悬疑剧《暗黑者》B组导演，豆瓣8.2评分，点击量达到 27.7 亿次。2014年，网剧《匆匆那年》选角导演，豆瓣8.1评分。</span></p>\"],\"imageUrl\":[\"http://124.223.119.22/profile/upload/2022/10/19/蔺水净，导演，内地新锐制作人。_20221019105509A001.png\"],\"imageSort\":[\"\"],\"created\":[\"\"],\"modified\":[\"\"]}', '{\"msg\":\"操作成功\",\"code\":0}', '0', null, '2022-10-19 11:02:12');
