INSERT INTO `sys_oper_log` VALUES ('541', '产业项目', '2', 'com.ruoyi.system.controller.IndustryProjectController.editSave()', 'POST', '1', 'admin', '研发部门', '/system/project/edit', '112.224.143.135', 'XX XX', '{\"id\":[\"1\"],\"type\":[\"1\"],\"projectName\":[\"低压槽\"],\"directorName\":[\"张家辉\"],\"writersName\":[\"张家辉、文宁\"],\"starring\":[\"张家辉、徐静蕾、何炅、余男\"],\"releaseTime\":[\"2018-04-18\"],\"synopsis\":[\"“孤城”是一座浮华却堕落的罪恶之城，警方卧底于秋（张家辉饰）在上司阿占（何炅饰）的运筹帷幄之下，成功斡旋于多方黑恶势力之中，长期卧底生活也让于秋渐渐迷失自我。然而，于秋内心对惩治罪恶的欲望从未消减，他重整旗鼓决定回归，而这一次，阿占给他的任务竟然是调查罪恶之城背后最邪恶也最神秘的黑手、令人闻风丧胆的头目——“老板”。通过一宗儿童绑架案，于秋和阿占终于摸清老板底细，对方已经控制了商界和黑道，更将势力渗透至警方权力高层，令所有人没想到的是，于秋在追查过程中已经踏入老板设下的重重圈套。腹背受敌的于秋在层层迷局之中，似乎被推向更深的绝望之中。\"],\"imageSort\":[\"1\"],\"created\":[\"\"],\"modified\":[\"\"],\"platform\":[\"\"],\"imageUrl\":[\"http://124.223.119.22/profile/upload/2022/10/19/低压槽_20221019144826A006.avif\"]}', '{\"msg\":\"操作成功\",\"code\":0}', '0', null, '2022-12-05 14:14:34');
