INSERT INTO `sys_oper_log` VALUES ('561', '产业项目', '2', 'com.ruoyi.system.controller.IndustryProjectController.editSave()', 'POST', '1', 'admin', '研发部门', '/system/project/edit', '218.57.140.130', 'XX XX', '{\"id\":[\"111\"],\"type\":[\"2\"],\"projectName\":[\"千古玦尘\"],\"directorName\":[\"尹涛、李才\"],\"writersName\":[\"\"],\"starring\":[\"周冬雨、许凯、张嘉倪、刘学义、赖艺、罗秋韵、张雅钦\"],\"releaseTime\":[\"2022-11-21\"],\"synopsis\":[\"《千古玦尘》根据星零所著仙侠小说《上古》改编，讲述了混沌之劫因主神上古的重生卷土重来。白玦为了不让上古再次牺牲，修炼出和主神一样的混沌之力，又为了不让上古伤心，对其绝情以令其断情，并最终代替上古以身化劫。上古失去挚爱， 终于明了白玦为自己做的一切。她肝肠寸断，唯用余生在天地间找寻着消散的爱人\"],\"imageSort\":[\"2\"],\"created\":[\"\"],\"modified\":[\"\"],\"platform\":[\"爱奇艺，腾讯\"],\"imageUrl\":[\"http://124.223.119.22/profile/upload/2022/10/19/千古玦尘竖_20221019145501A011.avif\"]}', '{\"msg\":\"操作成功\",\"code\":0}', '0', null, '2022-12-16 14:10:55');
